import styled from 'styled-components'

export const LoadMoreButtonStyled = styled.button`
	background-color: transparent;
	border: none;
	color: #3470ff;
	font-family: Manrope;
	font-size: 16px;
	font-style: normal;
	font-weight: 500;
	line-height: 24px;
	display: block;
	margin: 0 auto;
	margin-top: 20px;
	margin-bottom: 20px;
	cursor: pointer;
	&:hover {
		font-weight: bold;
	}
`
